00327         protected override void PopulateFrames()
00328         {
00329             int frameCount = TickEngineSettings.frameCount;
00330 
00332             if (framePool.Count == 0)
00333             {
00334                 frames = new Frame[frameCount + 1];
00336                 frames[frameCount] = new Frame(this, frameCount);
00337                 for (int i = 0; i <= frameCount; ++i)
00338                     frames[i] = new Frame(frames[frameCount], i);
00339             }
00340             else
00341             {
00343                 frames = framePool.Pop();
00345                 frames[frameCount].Set(this, frameCount);
00346                 for (int i = 0; i < frameCount; ++i)
00347                     frames[i].CopyFrom(frames[frameCount]);
00348             }
00349         }
