00409         {
00410             Frame frame = frames[frameId];
00411 
00412             bool hasTeleported = frame.hasTeleported;
00413             bool mustSend = hasTeleported || (writeFlags & SerializationFlags.NewConnection) != 0;
00414 
00418             if (!mustSend && !isActiveAndEnabled)
