00610         public override bool OnInterpolate(int snapFrameId, int targFrameId, float t)
00611         {
00612             if (skipInterpolation)
00613                 return false;
00614 
00615             bool ready = base.OnInterpolate(snapFrameId, targFrameId, t);
00616 
00617             if (!ready)
00618                 return false;
00619 
00620             if (interpolation == Interpolation.None)
00621                 return false;
00622 
00623             if (ReferenceEquals(targFrame, null))
00624                 return false;
00625 
00626             if (snapFrame.content == FrameContents.Empty)
00627                 return false;
00628 
00629             if (targFrame.content == FrameContents.Empty)
00630                 return false;
00631 
00632             if (snapFrame.parentHash != targFrame.parentHash)
00633                 return false;
00634 
00635             var snapM = snapFrame.hasTeleported ? snapFrame.telem : snapFrame.m;
00636 
00637             if (interpolation == Interpolation.Linear/* || pre1Frame.content != FrameContents.Complete*/)
00638                 Matrix.Lerp(Matrix.reusable, snapM, targFrame.m, t);
00640             else
00641                 Matrix.CatmullRomLerpUnclamped(Matrix.reusable, prevFrame.m, snapFrame.m, targFrame.m, t);
00642 
00643             //if (transform.GetComponent<SyncPickup>())
00644             //Debug.Log(name + " OnInterpolate Completed " + targFrame.m.position);
00645 
00646             transformCrusher.Apply(transform, Matrix.reusable);
00647 
00648             return true;
00649         }
