00654         protected override void InterpolateFrame(Frame targframe, Frame startframe, Frame endframe, float t)
00655         {
00657             //if (GetComponent<SyncPickup>())
00658             //    Debug.Log("<b> Interp Frame</b> " + prevFrame.content + " : " + snapFrame.content + " " + start.parentHash + " : " + end.parentHash);
00659 
00661             if (startframe.parentHash == -2 || startframe.parentHash != endframe.parentHash)
00662             {
00663                 targFrame.content = FrameContents.Empty;
00664                 //targ.CopyFrom(end);
00665             }
00666             else
00667             {
00668                 targframe.CopyFrom(endframe);
00669                 Matrix.Lerp(targframe.m, startframe.hasTeleported ? startframe.telem : startframe.m, endframe.m, t);
00670                 transformCrusher.Compress(targframe.cm, targframe.m);
00671             }
00672         }
