00704                 //        + snapFrame.m.position + " -> " + snapFrame.telem.position + (prevFrame.hasTeleported ? " <b><color=red>tele</color></b>" : ""));
00705 
00706                 return;
00707             }
00708 
00709 #if DEVELOPMENT_BUILD || UNITY_EDITOR
00710 
00713             if (snapframe.parentHash != teleNewParentId)
