00720             }
00721 #endif
00723             var prevContent = prevframe.content;
00724             if (prevContent == FrameContents.Empty)
00725             {
00726                 //if (GetComponent<SyncPickup>())
00727                 //    Debug.Log(Time.time + " <b>targframe: " + targFrame.frameId + "   " + targFrame.m.position + " "
