00732             }
00733 
00734 
00738             if (prevContent == FrameContents.Complete)
00739             {
00740                 var prevpar = prevframe.parentHash;
00741                 if (prevpar == -2 || prevframe.hasTeleported || prevpar != snapframe.parentHash)
00742                 {
00743                     //if (GetComponent<SyncPickup>())
00744                     //    Debug.Log(Time.time + " <b>" + targFrame.frameId
