00757             //    + pre1Frame.parentHash + ":" + snapFrame.parentHash + " " + pre1Frame.m.position + " " + snapFrame.m.position + "</color>");
00758 
00759             Matrix.LerpUnclamped(targframe.m, prevframe.hasTeleported ? prevframe.telem : prevframe.m, snapframe.m, 1 + extrapolateRatio);
00760             transformCrusher.Compress(targframe.cm, targframe.m);
